import React from 'react';
import Row from 'react-bootstrap/Row';

export default function Nome(){
    return(
        <div>
            <Row style={{ padding: '50px' }}>
              <h1 style={{fontSize:'80px',fontFamily:'sans-serif',fontStyle:'italic'}}>Rafaela Viana</h1>
              <h4 style={{fontSize:'40px'}}>Programadora Web</h4>
            </Row>
            
        </div>
    )
}
